    render(){
        return <div className="newsletter">
                    <div className="newsletter__container">
                        <h4>Sign up for the newsletter and get exclusive deals.</h4>
                        <input type="text" name="email"/>
                    </div>
               </div>     
    } 
}

export default Newsletter;
